;; gorilla-repl.fileformat = 1

;; **
;;; # Smoothing
;; **

;; **
;;; Smoothing, or blurring, is usually one the first step of your image processing pipeline. 
;;; 
;;; There are many reasons for smoothing, but the main one is surely reducing noise, ie artefacts that get in the way of your region of interest.
;;; 
;;; This recipe focus on blurring in the context of drawing edges, so after applying different blur processing on the image, we will see what the impact is on the drawn edges, using a simple canny function call.
;; **

;; @@
(ns balmy-leaves
 (:require
  [opencv4.core :refer :all]
  [opencv4.utils :as u]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(comment 
  
  (def neko
  (-> 
    "https://www.smashingmagazine.com/wp-content/uploads/2016/06/Tools-large-opt.jpg"
    (u/mat-from-url)
    (u/resize-by 0.2)
    ))
  )

(def neko (-> "resources/tools/set4.jpg" imread (u/resize-by 0.2)     
              (copy-make-border! 2 2 2 2 BORDER_CONSTANT (new-scalar 0 0 0))))

(u/mat-view neko)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"244\" height=\"290\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7cbe831e \"BufferedImage@7cbe831e: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@576ad4d9 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 244 height = 290 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(->
  neko
  (clone)
  (cvt-color! COLOR_RGB2GRAY)
  (canny! 300.0 100.0 3 true)
  (bitwise-not!)
  (u/mat-view)  )
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"244\" height=\"290\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xf1fc0bd \"BufferedImage@f1fc0bd: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@c0757ad transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 244 height = 290 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; We will use a simple annotate function to mark the image with the factor used to generate images.
;; **

;; @@
(defn annotate![mat text]
 (put-text mat
  text (new-point 20 20) FONT_HERSHEY_PLAIN 1 (new-scalar 0 0 0) 1)
 mat)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;balmy-leaves/annotate!</span>","value":"#'balmy-leaves/annotate!"}
;; <=

;; **
;;; ## Median Filter 
;;; 
;;; The median filter run through each element of the signal (in this case the image) and replace each pixel with the median of its neighboring pixels (located in a square neighborhood around the evaluated pixel).
;;; 
;; **

;; @@
(map  
#(-> neko 
     (clone)  
     (median-blur! %)
     (annotate! (str "blur " %)) 
     (u/mat-view))
(filter odd? (range 3 25)))
